import * as React from 'react';
import Link from '@mui/material/Link';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Title from './Title';
import { useSelector } from 'react-redux';

/*// Generate Order Data
function createData(id, date, name, shipTo, paymentMethod, amount) {
  return { id, date, name, shipTo, paymentMethod, amount };
}*/
function preventDefault(event) {
  event.preventDefault();
}

export default function Orders() {
  const rows = useSelector((state) => state.userReducer.users);

  console.log(rows);
  return (
    <React.Fragment>
      <Title>Liste candidat</Title>
      <Table size="small">
        <TableHead>
          <TableRow>
          <TableCell>Name</TableCell>
            <TableCell>Date naissance</TableCell>
            <TableCell>Email</TableCell>
            <TableCell>IsBanned</TableCell>
            <TableCell align="right">Role</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.fullName}</TableCell>
              <TableCell>{row.dateNais}</TableCell>
              <TableCell>{row.email}</TableCell>
              <TableCell>{row.isBanned}</TableCell>
              <TableCell align="right">{row.isBanned}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <Link color="primary" href="#" onClick={preventDefault} sx={{ mt: 3 }}>
        See more orders
      </Link>
    </React.Fragment>
  );
}
